import React, { Component } from 'react'
import { Text, View, StyleSheet, Animated, TouchableOpacity, Dimensions, Button } from 'react-native'

const { width, height } = Dimensions.get("window");

class Home extends Component {
   constructor(props) {
      super(props);
      this.state = {
         width: Dimensions.get('window').width,
         data:''
      };
   }
   componentDidMount(){
      const data = this.props.route.params.data
      this.setState({
      data:data
      });
      }
   render() {


      return (
         <View>
            <Text>Name: {this.state.data.name}</Text>
              <Text>Email: {this.state.data.userEmail}</Text>
         </View>

      )
   }
}
export default Home

const styles = StyleSheet.create({
   container: {
      justifyContent: 'flex-start',
      alignItems: 'flex-start',

   },
   box: {
      backgroundColor: 'green',
      width: 1000,
      height: 100,

   },
   box2: {
      backgroundColor: 'green',
      width: 200,
      height: 50,
      alignSelf: 'center'

   },
})
